.banner-central {
    background: url(../img/uploads/bg-center.jpg) no-repeat center top;
    min-height: 291px;
    padding-top: 20px;
}
.banner-tarja {
    justify-content: center;
    display: flex;
    flex-direction: column;
    align-items: center;
    align-content: center;
    text-align: center;
}
.banner-tarja .img-info {}
.banner-tarja .span {}
.custom-html .container:first-child {
    max-width: 100%;
}
.custom-html {
    margin: 0;
    padding: 0;
}
.custom-html .container .banner-central .container {
    max-width: 1250px !important;
    display: flex;
    flex-direction: row;
    justify-content: space-between;
    align-items: center;
    align-content: center;
    font-family: ui-monospace;
}

.banner-tarja div:last-child{
    flex-direction: column;
    display: flex;
    font-family: 'Ubuntu', sans-serif;
    color: #151515;
    font-size: 16px;
    line-height: 20px;
    font-weight: 500;
    margin-top: 10px;
}
